'Action commissions'=>'Eylem komisyonları',
'Action Commissions feature allows you to define per action, or per "anything" commissions.<br/>This way you can define commissions for example per user registration, per download, per visiting specific page, etc.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Eylem komisyonları özelliği her eylem için komisyon belirlemenizi sağlar. Bu herşey olabilir.<br/>Bu yöntemle komisyonlarınızı yapılan her yeni kayıt, her dosya indirimi, bazı sayfaların ziyareti vb konularda oluşturabilirsiniz.<br/><a href="%s" target="_blank">Daha fazla bilgi için bilgi bankamıza göz atın.</a>',
'More help in our Knowledge Base'=>'Daha fazla yardım bilgi bankamızda',
'Banner rotator is a special type of banner that rotates other banners.<br/>When affiliate inserts rotator to his page, the rotator displays banners that are assigned to the rotator, so the visitor will see another banner every time he visits the affiliates page.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Reklam (Banner) dönüştürücü diğer reklamları dönüşümlü yayınlayan özel bir reklam türüdür.<br/>İş Çemberi Uzmanı bu reklamı sayfasına eklediğinde, buna atanan reklamlar dönüşümlü yayınlanır. Ziyaretçiler sayfayı her ziyaretinde farklı bir reklam görür.<br/><a href="%s" target="_blank">Daha fazla bilgi için bilgi bankamıza göz atın.</a>',
'Branding free'=>'Marka Özelleştirme',
'Branding Free is a special feature that allows you to change the links in the footer of panels and signup form from "Powered by %s" to your own text and link.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Marka özelleştirme özel bir özelliktir. Sayfa sonlarında, kayıt sayfalarında ve kullanıcı panellerinde yer alan linkleri "Powered by %s" kendi yazı ve linkleriniz ile değiştirmenizi sağlar.<br/><a href="%s" target="_blank">Daha fazla bilgi için bilgi bankamıza göz atabilirsiniz</a>',
'Commission Groups'=>'Komisyon grupları',
'Commission groups allow you to set different commissions for different users for the same campaign.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Komisyon grupları aynı kampanya için farklı kullanıcılara farklı komisyonlar belirlemenizi sağlar.<br/><a href="%s" target="_blank">Daha fazla bilgi için bilgi bankamıza göz atın</a>',
'CPM commissions'=>'CPM Komisyonları',
'CPM (cost per mille) commissions are a special type of commissions that are rewarded for 1000 impressions, which means for displaying your banners 1000 times.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'CPM (cost per mille) Bu komisyon her 1000 izlenim için özel komisyonlar oluşturmanızı sağlar. Yani reklamınızın (Banner) 1000 kez görülmesinden sonra komisyon oluşturur.<br/><a href="%s" target="_blank">Daha fazla bilgi için bilgi bankamıza göz atın</a>',
'Forced matrix allows you to limit to the number of referrals of subaffiliates any affiliate can refer. It means that every affiliate can have only specified number of children. <a href="%s" target="_blank">More details read in our Knowledge Base</a>'=>'Sınırlama matrisi İş Çemberi Uzmanlarının size yapacağı kişi tavsiyesini sınırlar. Her İş Çemberi Uzmanı ancak sizin belirlediğiniz sayı kadar tavisyede bulunabilir. <a href="%s" target="_blank">Daha fazla bilgi için bilgi bankamıza göz atın</a>',
'Hosting of %s on  %s servers.'=>'Web alanı %s bu  %s sunucuda.',
'Multiple currencies allow you to track sales in multiple currencies.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Çoklu para birimi ile çalışma özelliği sizin satışları birden fazla para birimi ile takip etmenizi sağlar.<br/><a href="%s" target="_blank">Daha fazla bilgi için bilgi bankamıza göz atın</a>',
'Multiple merchants'=>'Birden Fazla Yönetici',
'Performance rewards is a powerful featuure that allows you to reward your affiliates for their performance.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Performans ödlüllendirme sistemi, İş Çemberleri Uzmanlarını performanslarına göre ödüllendirmenizi sağlar.<br/><a href="%s" target="_blank">Daha fazla bilgi için bilgi bankamıza göz atın</a>',
'By default, all campaigns in %s are public, which means that all affiliates can view and promote them. Private campaigns feature allows you to create private campaigns, which will be visible only to selected affiliates.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Varsayılan olarak tüm kampanyalar %s genel kullanıma açıktır. İş Çemberi Uzmanları bunları görebilir ve tanıtabilirler. Özel kampanyalar özelliği sadece seçilen İş Çemberi Uzmanları tarafından görülebilir ve kullanılabilir.<br/><a href="%s" target="_blank">Daha fazla bilgi için bilgi bankamıza göz atın</a>',
'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>'=>'Özel türde promosyon materyalleri yaratmanızı (markalanabilen e-kitaplar) sağlar. PDF dökümanınızı, e-kitabınızı oluşturduktan sonra %s web sitenize yükleyebilirsiniz. İş Çemberi Uzmanları bu dökümanı indirmek istediklerinde döküman otomatik olarak kendi isimlerine (isim, bağlantı adresi, metin vb) markalanacaktır. Bu işlem için dışarıdan her hangi bir program kullanılmasına gerek yoktur. Sadece dökümanı web sitesinden indirmeleri yeterlidir. Tüm markalama işlemi arka planda otomatik olarak yapılmaktadır.<br/><a href="%s" target="_blank">%s</a>',
'Recurring commissions allow you to reward your affiliates for recurring payments, for example for hosting or membership. <br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Tekrarlayan komisyonlar İş Çemberi Uzmanlarınızı üyelik gibi uzun süreli satışlardan komisyon almalarını sağlayacaktır. <br/><a href="%s" target="_blank">Daha fazla bilgi için bilgi bankamıza göz atın</a>',
