'It is possible to use following values in ID: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be copied to refid as you will specify in format. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'ID içerisinde muhtemel yer alabilecek değerler: {9} - [0-9] bu sayılar arasında bir değer ile değiştirilecektir, {z} - [a-z]karakerleri arasında bir değerle değiştirilecektir, {Z} - [A-Z]karakerleri arasında bir değerle değiştirilecektir, {X} -  [0-9a-zA-Z]karakerleri arasında bir değerle değiştirilecektir, refid alanı için belirlediğiniz biçime uygun tüm karakterler kopyalanacaktır. İyi bir format şöyle olmalıdır:{ZZZ}-{XXXXX}-{999}',
'Refid format saved'=>'Refid biçimi kayıt edildi',
'Refid must be in format "%s". Format definition: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be unchanged. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'Refid alan değeri şu şekilde olmalıdır "%s". Veri biçimi: {9} - [0-9] bu sayılar arasında bir değer ile değiştirilecektir, {z} - [a-z]karakerleri arasında bir değerle değiştirilecektir, {Z} - [A-Z]karakerleri arasında bir değerle değiştirilecektir, {X} -  [0-9a-zA-Z]karakerleri arasında bir değerle değiştirilecektir, uygun olan karakterler değiştirilmeyecektir. İyi bir format şöyle olmalıdır {ZZZ}-{XXXXX}-{999}',
